import React from "react";
//import CardBtn from "../CardBtn";
import "./style.css";
import storeSchema from ".../models/Books.js"

function Card(props) {
  return (
    <div
      className="card"
     
    >
      {!storeSchema.photo && <i className="fa fa-spinner fa-spin" aria-hidden="true" />}
     
    </div>
  );
}

export default Card;
